import UIKit

class ViewController: UIViewController, UITableViewDelegate, UITableViewDataSource {
    
    
    @IBOutlet weak var tvCovid: CeldaCovidController!
    var covicho : [Covid] = []
    
    func tableView(_ tableView: UITableView, heightForRowAt indexPath: IndexPath) -> CGFloat {
        return 150
    }
    
    func numberOfSections(in tableView: UITableView) -> Int {
        return 1
    }
    
    func tableView(_ tableView: UITableView, numberOfRowsInSection section: Int) -> Int {
        return covicho.count
    }
    
    func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
        let celda = tableView.dequeueReusableCell(withIdentifier: "celdaCovid") as! CeldaCovidController
        celda.lblLineage.text = covicho[indexPath.row].lineage
        celda.lblDate.text = covicho[indexPath.row].date
        celda.lblAssigned.text = covicho[indexPath.row].assigned
        celda.lblDessigned.text = covicho[indexPath.row].dessigned
        celda.lblNombre.text = covicho[indexPath.row].name
        return celda
    }
    
    override func prepare(for segue: UIStoryboardSegue, sender: Any?) {
        let destino = segue.destination as! DetallesCovidController
        
        destino.covicho = covicho[tvCovid.indexPathForSelectedRow!.row]
    }
    

